import {
    Button,
    Icon,
    Rating,
    Header,
    Input,
    Grid,
    Segment,
    Form,
    Message,
    Menu,
    Modal,
    Dropdown,
    Label
} from 'semantic-ui-react';

export default class SignIn extends Component {
render() {
    return (
        <div>
           <Button content="Like" icon={(Component, componentProps) => <Label basic>+1</Label>} />
        </div>
    )
    }
}
